<h2>Example vector of DysGPS in p53 data.</h2>

<h3>Description</h3>

<p>The score vector of 164923 gene pairs from p53 dataset. 
It can be loaded from the example datasets of R-package 'DysPIA', 
and also can be obtained by running DysGPS(), details see DysGPS.R
</p>


<h3>Usage</h3>

<pre><code class="language-R">data(DysGPS_p53)
</code></pre>
